INSERT INTO `community` VALUES (8,2,'https://vkceyugu.cdn.bspapp.com/VKCEYUGU-e9420bcd-26cd-4faf-b47a-9949982f7c41/b35e0e53-2f27-43ab-82d1-111cf2ba45d7.jpeg','阿米尔','[\"http://localhost:9527/api/getImage?url=upload/img/c02b5d4ccec4016af2c3797a271a7b66光头.jpeg\",\"http://localhost:9527/api/getImage?url=upload/img/84addc33c05b1d2eabd6566b6d1463af小新.jpg\"]',NULL,NULL,'好好学习哈哈哈','2022-2-23- 15:28:35',0,0,0,0,0,0,0),(9,7,'https://vkceyugu.cdn.bspapp.com/VKCEYUGU-e9420bcd-26cd-4faf-b47a-9949982f7c41/c821ed00-aac4-442f-8be3-0acdd5932d39.jpeg','叶藏','[\"http://localhost:9527/api/getImage?url=upload/img/7b46f9e9972d3ba78aba88dc8547e3e8990e2f57-7cec-4ae9-8422-416e21656c2e.jpg\",\"http://localhost:9527/api/getImage?url=upload/img/db82ead49b8da2cd3b587f315328b5080c275636-e72d-420c-90c4-2908ebc3a939.jpg\",\"http://localhost:9527/api/getImage?url=upload/img/fd5c4c29b70a838326256fae93ad51add03d3a74-dc40-4e16-b3d6-f523bc45eb1f.jpg\",\"http://localhost:9527/api/getImage?url=upload/img/b2e6c37854045570a4cdaec425502c29990e2f57-7cec-4ae9-8422-416e21656c2e.jpg\",\"http://localhost:9527/api/getImage?url=upload/img/5df19e656353ec01e548c2643d7bdd430c275636-e72d-420c-90c4-2908ebc3a939.jpg\",\"http://localhost:9527/api/getImage?url=upload/img/989d74633e4ab0bc9e6ac4b43a662ea4d03d3a74-dc40-4e16-b3d6-f523bc45eb1f.jpg\"]',NULL,NULL,'美丽的花儿总是会枯萎，正如年轻的人总会老去。珍惜每天，向阳日上~','2022-2-23- 20:17:20',0,0,0,0,0,0,0),(10,10,'https://vkceyugu.cdn.bspapp.com/VKCEYUGU-e9420bcd-26cd-4faf-b47a-9949982f7c41/f4db3fb9-0f15-4b8d-b90f-15ebfaf0621e.jpeg','公埃斯梅拉达','[\"http://localhost:9527/api/getImage?url=upload/img/523cc1216b0877ddc181fdbd1f5b49f34.png\"]',NULL,NULL,'有时，写的东西没人看或被嘲讽，会觉得这个世界没人懂我，但这几年下来，已不痛不痒。一个人到电影院，一边看自己喜欢电影，一边傻笑，也不失为乐趣。偶尔趁舍友出去的邂逅黄昏傍晚，吹点小风，喝点热茶，放点轻快的音乐在宿舍里扭两下，也是一种享受。没人陪你跑步，就尝试独自慢跑；觉得进像样餐厅尴尬，就跑叫外卖；没人为你解题，那就再冥思苦想，一切都会水到渠成；没人陪你说话，你可以尝试写日记，把想说的话写下来，让日记做你的朋友。','2022-2-23- 20:25:51',0,0,0,0,0,0,0),(25,6,'https://vkceyugu.cdn.bspapp.com/VKCEYUGU-e9420bcd-26cd-4faf-b47a-9949982f7c41/bf9378c0-a651-41aa-96ab-e20228349c48.jpeg','卡雷特·奥哈拉','[]',NULL,NULL,'希望你适应孤独，以及它带给我们的一切。毕竟一个人要走的路很长，我们总要尝试一个人看一场电影，一个人坐在图书馆里看完一本书，一个人撒欢地坐上公交车在回家的路上，无拘无束，想看书就看书，饿了就吃，累了就睡觉，不想联络谁就自己安静一阵。','2022-3-15- 16:48:41',0,0,0,0,0,0,0);
